import React, { Component } from 'react';
import { Bills } from '../../Fetches/Queries';

class Reports extends Component {
  constructor() {
    super();
    this.state = {
      bill: '',
      keys: ''
    };
    this.fetchBill = this.fetchBill.bind();
  }
  fetchBill = async () => {
    let a = await Bills();
    await this.setState({ bill: a });
    await this.setState({
      keys: a.map(i => Object.keys(i))
    });
  };
  componentDidMount() {
    this.fetchBill();
  }
  render() {
    return (
      <div>
        {console.log(this.state)}
        HI
      </div>
    );
  }
}

export default Reports;
